import { Paper, Title, Text } from '@mantine/core';

const GPTSummary = ({ summary }) => {
  return (
    <Paper padding="md" shadow="xs">
      <Title order={3}>GPT 요약</Title>
      <Text>{summary}</Text>
    </Paper>
  );
};

export default GPTSummary;
